          <p class="col-md-4 mb-0 text-body-secondary">&copy; 2024 Tech Tana. All rights reserved.</p>
          <ul class="nav col-md-4 justify-content-end">
            <li class="nav-item"><a href="privacy_policy.html" class="nav-link px-2 text-body-secondary">Privacy Policy</a></li>
            <li class="nav-item"><a href="terms_of_use.html" class="nav-link px-2 text-body-secondary">Terms of Use</a></li>
          </ul>
        </footer>
      </div>
    );
  }

  
export default Footer;
